import { Button } from '@material-ui/core';
import { green } from '@material-ui/core/colors';
import { makeStyles } from '@material-ui/core/styles';

export default makeStyles(() => ({
    form: {
        display: 'flex',
        flexDirection: 'column',
    },
    input: {
        marginTop: '20px'
    },
    buttonSubmit: {
        marginTop: '20px',
        borderRadius: '20px'
    }
}))
